import { Component } from "react";
import "./App.css";
import logo_white from "./logo/logo_white.png";
import Button from "@mui/material/Button";
import ButtonGroup from "@mui/material/ButtonGroup";
import Box from "@mui/material/Box";

class App extends Component {
  render() {
    const back = {
      backgroundColor: "grey",
    };
    return (
      <div className="App">
        <body className="Body">
          <header className="Nav">
            <img src={logo_white} className="Logo" />
          </header>
          <Box
            sx={{
              display: "flex",
              flexDirection: "column",
              alignItems: "center",
              "& > *": {
                m: 2,
              },
            }}
          >
            <ButtonGroup
              size="large"
              variant="text"
              aria-label="text button group"
              color="inherit"
            >
              <Button onClick={activateSearchTab}>검색</Button>
              <Button onClick={activateMap}>지도</Button>
            </ButtonGroup>
          </Box>
        </body>
      </div>
    );
  }
}

export default App;
